import React from "react";

const EventBanner = () => {
  return (
    <section className="event_banner_area" style={{ background: `#385a5d` }}>
      <div
        className="parallax-effect"
        style={{
          backgroundImage:
            "url(" + require("../../img/home-event/banner_bg.jpg") + ")",
        }}
      ></div>
      <div className="container">
        <div className="event_banner_content">
          <div className="round wow zoomIn" data-wow-delay="0.2s"></div>
          {/* <h6 className="wow fadeInUp" data-wow-delay="0.6s">January 24, 2020</h6> */}
          <h2 className="wow fadeInUp" data-wow-delay="0.8s">
            <span>Shop </span>Smarter
            <br /> for Your Next Home
          </h2>
          {/* <a
            className="event_btn event_btn_two btn_hover wow fadeInRight badge-success"
            data-wow-delay="0.9s"
            href="/#"
            style={{
              background: `#385a5d`,
              color: `white`,
              border: `thin solid white`,
            }}
          >
            Download for iOS
          </a> */}
          <a
            className="event_btn event_btn_two btn_hover wow fadeInRight badge-success"
            data-wow-delay="0.9s"
            href="/#"
            style={{
              background: `#385a5d`,
              color: `white`,
              border: `thin solid white`,
            }}
          >
            Get Starte
          </a>
        </div>
      </div>
    </section>
  );
};

export default EventBanner;
